import { useHistory  } from "react-router-dom";
import { Link,Layout, Menu } from 'antd';


const UserNavBar = () => {

  let history = useHistory();

  const onHome = () =>{
    history.push("/user");


  };


  const onLogOut =()=>{
      history.push("/logout");
  };


  const { Header } = Layout;

  return(
    <Layout>
      <Header className="header">
        <div className="logo" />
        <Menu theme="dark" mode="horizontal" style={{padding:"0 600px"}} defaultSelectedKeys={['1']}>
          <Menu.Item key="1" onClick ={onHome}>Home</Menu.Item>
          <Menu.Item key="2" onClick ={onLogOut}>LogOut</Menu.Item>
        </Menu>

      </Header>

    </Layout>
  );

};
export default UserNavBar;
